import Datas from '../data/data';

export default function Slider() {
    return (
        <main className='home-gallery'>
            {Datas.map(data => {
                return (
                    <div
                        key={data.id}
                        style={{
                            backgroundImage: `url(${data.cover})`,
                            backgroundSize: 'cover',
                            backgroundPosition: 'center'
                        }}
                    >
                        <h2>{data.title}</h2>
                    </div>
                )
            })}
        </main>
    )
}
